		//RESET GAME
		
		function resetGame() {
			
			//Reset elements
			spawnHearts();
			spawnGroundObstacle();
		    spawnDroidUps();
		    spawnBlueMilks();
		
			
			createjs.Ticker.addEventListener("tick", onTick);
			window.addEventListener("keydown", onKeyDown);
			window.addEventListener("keyup", onKeyUp);
				
			//Reset enemy speed
			gameRunTime = 0;
			lastSpeedUpdateTime = 0;
			enemyInitialSpeed = 25;
			groundXSpeed = 20;
			
			for (var g = 0; g < groundObstacles.length; g++){
				groundObstacles[g].speedX = enemyInitialSpeed;
			}
		
			for (var u = 0; u < droidups.length; u++){
				droidups[u].speedX = enemyInitialSpeed;
			}
			
			//Reset player
			player.visible = true;
			player.y = 262;
			
			ground.visible = true;
			
			// Score
			score = 0;
			updateScore();
		
		}
		
		
		
		//TICKER
		
		createjs.Ticker.addEventListener("tick", onTick);
		
		function onTick(evt){
			
			//Enemy Speed Update
			gameRunTime += evt.delta;
			
			if (gameRunTime - lastSpeedUpdateTime >= 5000){
				updateEnemySpeed();
				updateGroundPlaySpeed();
				
				console.log("enemy speed updated as:", enemyInitialSpeed);
				console.log("ground speed updated as:", groundXSpeed);
				
				lastSpeedUpdateTime = gameRunTime;
			}
			
			//Runtime Score
			if (Math.floor(gameRunTime / 100) > Math.floor((gameRunTime - evt.delta) / 100)) {
				score += 1;
				updateScore();
			}
				
			
			//PLAYER JUMP
			jumpFunc();	
		
			// GROUND
			ground.x -= groundXSpeed;
			if (ground.x < groundXMin) {
				ground.x = groundXReset;
			}
			
			//MOVE BLUE MILK
			for (var m = 0; m < bluemilks.length; m++){
				
				var bluemilk = bluemilks[m];		
				
				if (bluemilk.currentLabel == "normal"){
					bluemilk.x -= bluemilk.speedX;
				
					if (bluemilk.x < -100){
						resetBlueMilk(bluemilk);
					}
					
					if (hitTestPoint(player, bluemilk.x, bluemilk.y)){
					//heart display +1
						gainHearts();
					
					//blue milk disappear
						bluemilk.gotoAndPlay("reset");
						
					//play success sound
						playSnd("PickSnd", 0.5, 0);
						
					//Add score
						score += milkPoint;
						updateScore();
						
					}
				} else if (bluemilk.currentLabel == "reset"){
					resetBlueMilk(bluemilk);
				}
			
			}
		
			//MOVE GROUND OBSTACLES
			for (var g = 0; g < groundObstacles.length; g++){
				var groundObstacle = groundObstacles[g];		
				
				groundObstacle.x -= groundObstacle.speedX;
				
				if (groundObstacle.x < -100){
					resetGroundObstacle(groundObstacle);
				}
				else
				{
					if (hitTestPoint(player, groundObstacle.x, groundObstacle.y)) {
						resetGroundObstacle(groundObstacle);
						removeHearts();
					}
				}
			}
			
		
			//MOVE BLAST
			for (var b = blasts.length-1; b >= 0; b--){
				
				var blast = blasts[b];		
				
				blast.x += blast.speedX;
				
				if (blast.x > stageWidth + 50){
					removeBlast(blast);
					//blast.visible = false;
				}
			
			}
		
		
		
			//MOVE DROID UP
			for (var u = 0; u < droidups.length; u++){
				
				var droidup = droidups[u];		
					
				if (droidup.currentLabel == "normal") {
					droidup.x -= droidup.speedX;
					
					if (droidup.x < -200) {
						resetDroidUp(droidup);
					}
				
					for (b = blasts.length-1; b >= 0; b--){
				
						blast = blasts[b];	
						//If hit by the blast
						if (blastActive && hitTestPoint(droidup, blast.x, blast.y)){
							
							//Play droid hit animation
							droidup.gotoAndPlay("hit");
							
							//Play droid hit sound
							playSnd("ExplodeSnd", 0.3, 12883);
							
							//Update score
							score += hitPoint;
							updateScore();
							
							//console.log("score added")
							
							removeBlast(blast);					
							
						}	
					}
					
				} else if (droidup.currentLabel == "reset"){
						resetDroidUp(droidup);
					
				}
			}
		    
				
		
			//Collide with Droid
				if (hitTestPoint(player, droidup.x, droidup.y + 50)) {
					
					resetDroidUp(droidup);
					removeHearts();
					
				}	
		
			
		
		}//END TICKER
		
		
		
		//JUMP FUNCTION
		
		function jumpFunc(){
			if (jumping == true){
				player.y += speedY;
			}
			//Height Limit
				if (player.y <= limitHeight){
					player.y = limitHeight;
					speedY = 0;
				}
			
			//Landing
				if (player.y > initialY){
					player.y = initialY;
					jumping = false;
				} else {
				speedY += gravity;
			}
		
		}//END JUMP FUNCTION
